import React from 'react'
import './ExpensesItem.css';

const ExpancesItems = (prop) => {
    const expenceDate = new Date(2022, 2, 28)
    const expenceTitle = 'Car Insurance';
    const expenceAmount = 1000;
    return (
        <div className='expense-item'>
            <div>{expenceDate.toISOString()}</div>
            <div className='expense-item__description'>
                <h2>{expenceTitle}</h2>
                <div className='expense-item__price'>${expenceAmount}</div>
            </div>
        </div>
    )
}

export default ExpancesItems
